import React from 'react';
import { List } from 'antd';

class ListUsers extends React.Component {
  constructor(props) {
    super(props)
  }



  booking = (id) => {
    console.log(id)
  }

  noBooking = () => {}



  render() {
    return (
      <>
        <List
          dataSource={this.props.data}
          renderItem={item => (
            <List.Item>
              <a style={{color: `${item[2]}`, border: 'none'}} onClick={this.booking(id)} id={item[0]}>{item[1]}</a>
            </List.Item>
          )}
        />
      </>
    )
  }
}

export default ListUsers;
